import React, { Component } from 'react';
import { PayrollEmployeeList } from './PayrollEmployeeList';
import { PayrollEmployee } from './PayrollEmployee';

export class Layout extends Component {
  static displayName = Layout.name;

    // eslint-disable-next-line no-useless-constructor
  constructor (props) {
    super(props);
    this.state = {
      showlist: true,
    };
  }

  handleChange(newValue) {
    this.setState({ showlist: newValue })
  }

  render () {
    return (
      <div className="Maindiv">
        <div className={this.state.showlist ? null : "hidden"} onChange={this.handleChange(false)}>
          <PayrollEmployeeList onChange={this.handleChange(false)}></PayrollEmployeeList>
        </div>
        <div className={!this.state.showlist ? null : "hidden"} onChange={this.handleChange(false)}>
        <PayrollEmployee onChange={this.handleChange(false)}></PayrollEmployee>
        </div>
      </div>
    );
  }
}
